body.query:
query GetHomeFeedPosts($page: Int!, $perPage: Int!) {
  getHomeFeedPosts(page: $page, perPage: $perPage) {
    ...PostFragment
    __typename
  }
}

fragment PostFragment on Post {
  id
  text
  type
  tokenizedText {
    type
    value
    __typename
  }
  createdAt
  reactionsLikeCount
  commentsCount
  user {
    id
    firstName
    lastName
    username
    userTypeId
    photo {
      id
      path
      width
      height
      __typename
    }
    __typename
  }
  reactions {
    id
    type
    __typename
  }
  media {
    id
    path
    width
    height
    mimetype
    __typename
  }
  group {
    id
    name
    isVerified
    isMember
    photo {
      id
      path
      width
      height
      __typename
    }
    __typename
  }
  sosAddress {
    id
    startLatitude
    startLongitude
    endLatitude
    endLongitude
    isLive
    __typename
  }
  editedAt
  __typename
}

query getGroupsByCategory($category: GroupDisplayCategory!, $limit: Int) {
  getGroupsByCategory(category: $category, limit: $limit) {
    id
    name
    uniqueName
    description
    privacy
    type
    createdAt
    photo {
      id
      path
      width
      height
      __typename
    }
    _count {
      members
      __typename
    }
    members {
      id
      user {
        id
        firstName
        lastName
        photo {
          id
          path
          __typename
        }
        __typename
      }
      __typename
    }
    isMember
    address {
      latitude
      longitude
      __typename
    }
    __typename
  }
}

query GetSplitsByCategory($category: GroupDisplayCategory!, $limit: Int) {
  getSplitsByCategory(category: $category, limit: $limit) {
    ...SplitListFragment
    __typename
  }
}

fragment SplitListFragment on Split {
  id
  name
  price
  isActive
  currency
  uniqueName
  isApproved
  isFlagged
  shippingMethod
  deliveryZonesIds
  localPickupAddress
  photos {
    id
    path
    __typename
  }
  splitSharePlatform {
    id
    banner
    logo
    name
    __typename
  }
  slots
  slotRecords {
    id
    quantity
    __typename
  }
  courier {
    deliveryZones {
      id
      state
      __typename
    }
    __typename
  }
  group {
    id
    name
    type
    privacy
    createdAt
    isMember
    creator {
      id
      username
      __typename
    }
    members {
      id
      user {
        id
        __typename
      }
      __typename
    }
    photo {
      id
      path
      __typename
    }
    __typename
  }
  __typename
}
